import React from "react";
import './App.css';
import logo from "./logo.png";

function Header() {
    return (
        <header>
            <div className="header-left">
                <img className="logo" src={logo} alt="Logo"/>
                <h1 className="logoH1">
                    MY PIZZA™
                    <p className="slogon">Безкоштовна доставка</p>
                </h1>
            </div>
            <nav>
                <ul>
                    <li className="phoneNumber">
                        <p>(012) 345-67-89</p>
                        <p>Працюємо з 10:00 до 22:00</p>
                    </li>
                    <li className="basket"><button><img src="./Cart.svg" alt="Cart"/>Кошик</button></li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
